import React from 'react';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between', // Adjusted to space-between
    alignItems: 'center',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '10px',
    width: '100%',
    boxSizing: 'border-box',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '100px',
    width: '100%',
    boxSizing: 'border-box',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '30px',
    width: '95.3%',
  },
};

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>About</li>
      <li style={styles.navLi}>Services</li>
      <li style={styles.navLi}>Contact</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const Footer = () => (
  <footer style={styles.footer}>
    <div>Contact Information: example@example.com</div>
  </footer>
);

const EmptyPage = () => (
  <div style={styles.app}>
    <NavBar />
    {/* Your content goes here */}
    <div style={{ flex: '1' }}></div> {/* Added empty div to push footer to the bottom */}
    <Footer />
  </div>
);

export default EmptyPage;
